import React from 'react';
import { Route } from 'react-router-dom';
import Login from './Login';
import App from './App';
const LoginRouter = () => {
  return (
    <>
        <Login />
        <Route exact path='/login' component={Login} />
    </>
  );
}

export default LoginRouter;
